import styled from 'styled-components';
import FilterItem from './filteritem/FilterItem';


const SearchUl = styled.ul`
    background: cyan;
    position: absolute;
    top: 35px;
    width: 100%;
    max-width: 800px;
    margin: 15px auto;
    padding: 10px;
    z-index:5;
`;

const FilterSearch = ({filtered}) => {
    const array = [];
    const RenderFilteredSearch = () => {
        filtered.forEach(item => {
            array.push(<FilterItem itemName={item.name}/>);
        });

    }


    return(
        <div>
        {array}
        </div>
    );
}

export default FilterSearch;
